import './App.css';
import { BrowserRouter as Router, Routes, Route, BrowserRouter } from 'react-router-dom';
import Login from './login/login';
import Sidi from './sidi';
import Jwadou from './jwadou';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Login />} />
          <Route path='/jwadou' element={<Jwadou />} />
          <Route path='/sidi' element={<Sidi />} />
          <Route path='/' element={<Uploadcour/>} />
                  <Route path='/agenda-sidi' element={<Agenda/>} />
                 <Route path='/profilj' element={<ProfilePage />} />
          {/* Other routes here */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
